import Header from "./components/Header";

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import "./App.css";

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
      </div>
      <Switch>
        <Route path="/add_book">
          <AddBook />
        </Route>
        <Route path="/">
          <BookList />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
